import React, { Component } from "react";
class UnconfirmedModalBody extends Component {
  state = {
    clients: this.props.client,
  };
  render() {
    console.log("cliente", this.state.client);
    return (
      <div>
        {this.state.clients.map((client) => (
          <div>
            <h5>NAG</h5>
            <p>{client.nag}</p>
            <h5>Nome di battesimo</h5>
            <p> {client.nome}</p>
            <h5>Data di nascita</h5>
            <p> {client.dataNascita}</p>
            <h5>Numero di telefono</h5>
            <div className="form-check">
              <input
                class="form-check-input"
                type="checkbox"
                value=""
                id="flexCheckDefault"
              />
              <label className="form-check-label" for="flexCheckDefault">
                {client.telefono}
              </label>
            </div>
            <h5>Email</h5>
            <div className="form-check">
              <input
                class="form-check-input"
                type="checkbox"
                value=""
                id="flexCheckDefault"
              />
              <label className="form-check-label" for="flexCheckDefault">
                {client.email}
              </label>
            </div>
            <br />
          </div>
        ))}
      </div>
    );
  }
}

export default UnconfirmedModalBody;
